CREATE TABLE "AUDIO_AMPLIFIER" 
(
    "ID" SERIAL PRIMARY KEY,
    "Product Group"	VARCHAR(512),
    "Status"	VARCHAR(512),
    "Compliance"	VARCHAR(512),
    "Class"	VARCHAR(512),
    "Output Power Typ (W)"	FLOAT,
    "VCC Max (V)"	FLOAT,
    "Output Type"	VARCHAR(512),
    "ton Typ (ms)"	FLOAT,
    "THD + N Typ (%)"	FLOAT,
    "IQ Typ (mA)"	FLOAT,
    "ISD Typ (nA)"	FLOAT,
    "Package Type"	VARCHAR(512),
    "MSL Type"	INT,
    "MSL Temp (°C)"	INT,
    "Pricing ($/Unit)"	FLOAT
);

